import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import TicTacToe from "./TicTacToe";
import UserFetcher from "./UserFetcher";

function Home() {
  return (
    <div style={{ textAlign: "center" }}>
      <h1>Assignment 01 - React</h1>
      <h3>Part 01: Tic Tac Toe</h3>
      <TicTacToe />
      <br />
      <Link to="/user">
        <button
          style={{
            padding: "10px 20px",
            fontSize: "16px",
            marginTop: "20px",
            cursor: "pointer",
          }}
        >
          Go to User Profile Lookup
        </button>
      </Link>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/user" element={<UserFetcher />} />
      </Routes>
    </Router>
  );
}

export default App;
